import '../introduce/css/header.css';

function HomeWrapPage(){
    return(
        <header>
            <ul id="HomeWrapPage-header">
                <li><img src=".mages/logo.png" /></li>
                <li>이주의 공부법</li>
                <li>플래너</li>
                <li>커뮤니티</li>
                <li>소개</li>
            </ul>
        </header>
    );
}

export default HomeWrapPage;
